import Navbar from "../components/Navbar";
import logo from "../image/yinEtYang.png";
import { Link} from "react-router-dom";
import "./Home.css";

function Home() {
  return (
    <div className="Home bg-gray-200 h-screen">
      <Navbar/>
      <div className=" bg-gray-200 h-screen ">
        <img
            className="w-96"
            src={logo}
            alt="Logo"
        />

        <img
        className="w-96"
        src={logo}
        alt="Logo"
        />

        <img
        className="w-96"
        src={logo}
        alt="Logo"
        />

      </div>
    </div>
  );
}

export default Home;
